pragma solidity ^0.4.18;

import "./interfaces/IERC20.sol";
import "./interfaces/IDAO.sol";
import "./interfaces/IForecasting.sol";
import "./interfaces/IRewardsModel.sol";
import "./CrowdsaleToken.sol";
import "./factories/TokenFactory.sol";
import "./factories/ForecastingFactory.sol";
import "./factories/RewardsModelFactory.sol";
import "./factories/CrowdsaleFactory.sol";
import "./CrowdsaleController.sol";
import "./Crowdsale.sol";
import "./interfaces/ICrowdsaleProcessor.sol";
import "./forecasting/UserStorage.sol";

contract DAO is IDAO {
    uint256 constant CROWDSALE_COUNTDOWN_PERIOD = 45 * 1 days;

    function DAO(
        string _name,
        string _tokenName,
        string _tokenSymbol,
        address _manager,
        address _owner,
        bytes32 _id,
        bytes32 _infoHash
    )
        public
        Version("1.1.0")
    {
        name = _name;
        manager = _manager;
        owner = _owner;
        id = _id;
        infoHash = _infoHash;

        uint256 nameLength = bytes(_tokenName).length;
        require(nameLength > 0);

        tokenName = _tokenName;

        uint256 symbolLength = bytes(_tokenSymbol).length;
        require(symbolLength <= 5 && symbolLength > 0);

        tokenSymbol = _tokenSymbol;

        stage = Stage.Initial;

        DAO_CREATED(owner, name, tokenSymbol, infoHash);
    }

    function setupParameters(
        address _forecastingFactory,
        address _rewardsModelFactory,
        address _tokenFactory,
        address _crowdsaleFactory,
        address _customCrowdsale,
        address _userStorage,
        uint256 _wingsReserveAmount
    )
        public
        onlyManager()
        requireStage(Stage.Initial)
    {
        tokenFactory = _tokenFactory;
        forecastingFactory = _forecastingFactory;
        rewardsModelFactory = _rewardsModelFactory;
        userStorage = _userStorage;
        crowdsaleFactory = _crowdsaleFactory;
        wingsReserveAmount = _wingsReserveAmount;

        if (_customCrowdsale != address(0)) {
            // this address can be 0 in case of regular crowdsale
            crowdsale = _customCrowdsale;
            token = ICrowdsaleProcessor(_customCrowdsale).getToken();
            IERC20 ccToken = IERC20(token);
            DAO_SETUP(crowdsale, token, ccToken.decimals());
        } else {
            DAO_SETUP(0, 0, 0);
        }
    }

    function createModel()
        public
        onlyOwner()
        hasntStopped()
        requireStage(Stage.Initial)
    {
        rewardsModel = RewardsModelFactory(rewardsModelFactory).create();
        RewardsModel(rewardsModel).transferOwnership(address(this));

        stage = Stage.ModelCreated;

        DAO_MODEL_CREATED(rewardsModel);
    }

    function createForecasting(
        uint256 _forecastingDurationInHours,
        uint256 _ethRewardPart,
        uint256 _tokenRewardPart
    )
        public
        onlyOwner()
        hasntStopped()
        requireStage(Stage.ModelCreated)
    {
        require(_tokenRewardPart > 0);

        forecasting = ForecastingFactory(forecastingFactory).create(
            msg.sender, // author
            manager, // XXX: set Wings contract address as foundation
            userStorage,
            rewardsModel,
            _forecastingDurationInHours
        );

        ERC20 wingsToken = UserStorage(userStorage).token();
        require(wingsToken.transfer(forecasting, wingsReserveAmount));

        IForecasting(forecasting).setWingsDeposit(wingsReserveAmount);

        // model now belongs to Forecasting
        Ownable(rewardsModel).transferOwnership(forecasting);

        ethRewardPart = _ethRewardPart;
        tokenRewardPart = _tokenRewardPart;

        stage = Stage.ForecastingCreated;

        DAO_FORECASTING_CREATED(forecasting, _ethRewardPart, _tokenRewardPart);
    }

    function startForecasting(
        uint256 _bucketMin,
        uint256 _bucketMax,
        uint256 _bucketStep
    )
        public
        onlyOwner()
        hasntStopped()
        requireStage(Stage.ForecastingCreated)
    {
        IForecasting fc = IForecasting(forecasting);

        fc.createFlatscaleBuckets(_bucketMin, _bucketMax, _bucketStep);

        startTimestamp = block.timestamp;
        endTimestamp = startTimestamp + (fc.duration() * 1 hours);
        crowdsaleStartDeadline = endTimestamp + CROWDSALE_COUNTDOWN_PERIOD;

        fc.startForecastingPeriod(startTimestamp);

        stage = Stage.ForecastingStarted;

        DAO_STARTED(0, _bucketMin, _bucketMax);
    }

    // Closes forecasting after forecasting period. Calls Forecasting.checkForSpam(),
    // On success, transfers state to ForecastingClosed, if failed: to IsSpam
    function closeForecasting()
        public
        requireStage(Stage.ForecastingStarted)
    {
        IForecasting fc = IForecasting(forecasting);
        fc.checkForSpam();
        stage = (fc.stage() == IForecasting.Stage.IsSpam) ? Stage.IsSpam : Stage.ForecastingClosed;
    }

    // Should be called if crowdsale hasn't been created before deadline
    function crowdsaleTimeIsOver()
        public
    {
        require(block.timestamp > crowdsaleStartDeadline);
        require(stage == Stage.ForecastingClosed || stage == Stage.TokenCreated);
        IForecasting(forecasting).stop();

        stage = Stage.CrowdsaleTimeIsOver;
    }

    function createToken(
        uint8 _decimals
    )
        public
        onlyOwner()
        hasntStopped()
        requireStage(Stage.ForecastingClosed)
    {
        // crowdsale != 0 means custom crowdsale
        require(crowdsale == address(0));

        token = TokenFactory(tokenFactory).create(
            tokenName,
            tokenSymbol,
            _decimals
          );

        stage = Stage.TokenCreated;

        DAO_TOKEN_CREATE(token, tokenName, tokenSymbol, _decimals);
    }

    function createCrowdsale(
        uint256 _minimalGoal,
        uint256 _hardCap,
        uint256 _prices1to4,
        uint256 _prices5to8
    )
        public
        onlyOwner()
        hasntStopped()
        requireStage(Stage.TokenCreated)
    {
        address daoCrowdsale = CrowdsaleFactory(crowdsaleFactory).create(
          token,
          forecasting
        );

        Crowdsale(daoCrowdsale).changeGoals(_minimalGoal, _hardCap);
        Crowdsale(daoCrowdsale).updatePrices(_prices1to4, _prices5to8);

        Ownable(token).transferOwnership(daoCrowdsale);
        Ownable(daoCrowdsale).transferOwnership(msg.sender);

        crowdsaleController = new CrowdsaleController(
          crowdsaleStartDeadline,
          msg.sender,
          address(this),
          ethRewardPart,
          tokenRewardPart,
          daoCrowdsale,
          forecasting,
          false
        );

        HasManager(daoCrowdsale).transferManager(address(crowdsaleController));

        Ownable(forecasting).transferOwnership(crowdsaleController);
        HasManager(forecasting).transferManager(crowdsaleController);

        crowdsale = daoCrowdsale;
        stage = Stage.CrowdsaleCreated;

        DAO_CROWDSALE_CREATED(daoCrowdsale, crowdsaleController, _minimalGoal, _hardCap, _prices1to4, _prices5to8);
    }

    function createCustomCrowdsale()
        public
        onlyOwner()
        hasntStopped()
        requireStage(Stage.ForecastingClosed)
    {
        // crowdsale != 0 means custom crowdsale
        require(crowdsale != address(0));

        crowdsaleController = new CrowdsaleController(
          crowdsaleStartDeadline,
          owner,
          address(this),
          ethRewardPart,
          tokenRewardPart,
          crowdsale,
          forecasting,
          true
        );

        ICrowdsaleProcessor(crowdsale).transferManager(address(crowdsaleController));

        Ownable(forecasting).transferOwnership(crowdsaleController);
        HasManager(forecasting).transferManager(crowdsaleController);

        stage = Stage.CrowdsaleCreated;

        DAO_CUSTOM_CROWDSALE_CREATED(crowdsale, crowdsaleController);
    }

    /*
        Update project media asset
    */
    function update(bytes32 _infoHash) public onlyOwner() inTime() hasntStopped()   {
        infoHash = _infoHash;
        DAO_UPDATE_INFO(infoHash);
    }

    /*
        Stop
    */
    function stop() public onlyOwner() hasntStopped() {
        if (crowdsaleController != address(0)) {
          CrowdsaleController(crowdsaleController).stop();
        } else if (forecasting != address(0)) {
          IForecasting(forecasting).stop();
        } else {
          ERC20 wingsToken = UserStorage(userStorage).token();
          // manager is Wings contract, XXX: and foundation
          require(wingsToken.transfer(manager, wingsReserveAmount));
        }

        super.stop();
        DAO_STOPPED(); // XXX: sum refunded to foundation here in event?
    }

    function setTime(uint /*_start*/, uint /*_end*/) public onlyManager() before() {
        revert();
    }
}
